import React, { Fragment } from "react";
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';

const Logbook = () => {
    return (
        <Fragment>
            <CssBaseline />
           
                <Box sx={{ bgcolor: '#d7d9d7', height: '100vh' }} />
            
        </Fragment>
    )
}

export default Logbook;
